none\" color=\"Accent-Color\" min_height=\"200\"]\n<h4>Visit records</h4>\nVisits are available for all ages — from children to seniors[/fancy_box][/vc_column][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/3\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\" enable_animation=\"true\" animation=\"grow-in\" delay=\"100\"][fancy_box box_style=\"default\" icon_family=\"none\" color=\"Accent-Color\" min_height=\"200\"]\n<h4>Experience</h4>\nU.S. board-certified doctors with an average of 20 years practice experience[/fancy_box][/vc_column][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/3\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\" enable_animation=\"true\" animation=\"grow-in\" delay=\"200\"][fancy_box box_style=\"default\" icon_family=\"none\" color=\"Accent-Color\" min_height=\"200\"]\n<h4>All ages</h4>\nVisits are available for all ages — from children to seniors[/fancy_box][/vc_column][/vc_row][vc_row type=\"in_container\" full_screen_row_position=\"middle\" scene_position=\"center\" text_color=\"dark\" text_align=\"left\" top_padding=\"10%\" bottom_padding=\"0\" overlay_strength=\"0.3\" shape_divider_position=\"bottom\" bg_image_animation=\"none\" shape_type=\"\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/1\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\"][vc_custom_heading text=\"Frequently Asked Questions\" font_container=\"tag:h2|font_size:35px|text_align:center|color:%23756e67\" use_theme_fonts=\"yes\"][/vc_column][/vc_row][vc_row type=\"in_container\" full_screen_row_position=\"middle\" scene_position=\"center\" text_color=\"dark\" text_align=\"left\" overlay_strength=\"0.3\" shape_divider_position=\"bottom\" bg_image_animation=\"none\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/2\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\"][toggles style=\"minimal\"][toggle color=\"Extra-Color-2\" title=\"What is Worklife Services?\"][vc_column_text]Worklife Services is a comprehensive telephone consultation service providing research and referral information for child care, elder care and care for people with disabilities.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"How does the benefit work?\"][vc_column_text]Simply call the toll free number on the back of the card 24 hours a day, 7 days a week to reach a counselor with outstanding educational credentials and professional experience. Starting with a national database of over 750,000 providers, the counselor will identify possible solutions and make between 20 to 30 calls to identify providers who match the specific family situation and ensure availability of care when it is needed.\n\nWithin 48 to 72 hours, a comprehensive referral packet is sent out. It contains profiles of providers who meet the family’s needs, specifies availability of service, and includes educational materials to assist the family in making a decision about care. Two weeks later, the counselor follows up to determine if a decision has been made, if the member needs more referrals, and to answer any additional questions.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"What types of problems does Worklife Services deal with?\"][vc_column_text]Expert counselors, experienced with the ins and outs of child and adult/elder care services, can help with:\n<ul>\n 	<li>Finding an in-home childcare provider for an infant or toddler</li>\n 	<li>Making transportation arrangements to the doctor for a disabled elder who is living alone in another state</li>\n 	<li>Understanding what Medicare, Medicaid or private insurance covers for an elderly relative’s care and identifying programs that are available at little or no cost</li>\n 	<li>Finding an after-school program or summer camp for a child in elementary school</li>\n 	<li>Understanding the costs of various living arrangements if an elder adult can no longer live independently at home</li>\n 	<li>Finding care for a child or adult with a debilitating disease</li>\n</ul>\n[/vc_column_text][/toggle][/toggles][/vc_column][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/2\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\"][toggles style=\"minimal\"][toggle color=\"Extra-Color-2\" title=\"What can I expect in the Provider Profile Packet?\"][vc_column_text]The packet contains profiles with each provider’s name, address, contact, title, services provided, applicable fees, and any other special comments. Depending on the services required members might receive additional information such as CPR/ First Aid certification information and admission requirements for a childcare center.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"What can I expect in the Educational Materials Packet?\"][vc_column_text]The Educational Materials Packet Members includes comprehensive notes and guidebooks covering a broad range of dependent care topics.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"Is there someone I can turn to with questions about my Worklife Services benefit?\"][vc_column_text]Yes. Simply call the toll-free number on the back of your membership card and an experienced counselor can help with any questions or concerns.[/vc_column_text][/toggle][/toggles][/vc_column][/vc_row]\";}s:20:\"benifits-2_160708486\";a:2:{s:4:\"name\";s:10:\"Benifits 2\";s:8:\"template\";s:40555:\"[vc_row type=\"full_width_background\" full_screen_row_position=\"middle\" bg_color=\"#f1f0ed\" scene_position=\"center\" text_color=\"dark\" text_align=\"left\" top_padding=\"10%\" bottom_padding=\"10%\" overlay_strength=\"0.3\" shape_divider_position=\"bottom\" bg_image_animation=\"none\" shape_type=\"\"][vc_column centered_text=\"true\" column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/1\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\"][vc_custom_heading text=\"Enjoy practical benefits\" font_container=\"tag:h1|font_size:61px|text_align:center|color:%23756e67\" use_theme_fonts=\"yes\"][vc_custom_heading text=\"Saving time and money has never been easier. Read more about benefits below.\" font_container=\"tag:p|font_siz